The Photoshop CS5 Pocket Guide.

In this handy new Pocket Guide, Photoshop expert Brie Gyncild introduces readers to the powerful features in Photoshop CS5, including new features like content-aware fill, HDR Pro, Bristle effects, Mixer Brush, and Puppet Warp. The book covers everything from navigating the interface and making basic edits to working with images in Camera Raw, making image corrections, and applying effects. There are chapters on merging photos, printing, and preparing images for the Web, as well as on organizing images in Bridge and automating tasks. This appealing, low-priced book is packed with quick results for people who want to jump in and get up to speed in Photoshop. This Pocket Guide offers a quick introduction to Photoshop CS5 and acts as a handy reference. Its exactly the guide many new Photoshop users want--no fluff; just the important stuff. 

